import logo from './logo.svg';
import './App.css';
import Affirmation from './components/DailyAffirmation/DailyAffirmation.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          The Joy Room
        </p>
        <Affirmation/>
      </header>
    </div>
  );
}

export default App;
